ابنِ نفسك أولا

د. أحمد عبد المنعم
@A_Abdelmonem82 https://t.co/4PM3boYlty

وهؤلاء هم الذين جمعوا بين البصيرة في الدين والقوة على الدعوة ولذلك كانوا ورثة الأنبياء {واذكر عبادنا إبراهيم وإسحاق ويعقوب أولي الأيدي والأبصار}

فالأيدي القوة في أمر الله والأبصار البصائر في دينه؛ فبالبصائر يدرك الحق ويعرف، وبالقوة يتمكن من تبليغه وتنفيذه والدعوة إليه

